import "./App.css";
import Header from "./Components/Header";

function App() {
  return (
    <div className="App">
      <Header />
      <main
        className=""
        style={{ backgroundImage: `url("img/background.jpeg")` }}
      >
        <div className="main-wrapper main-image">
          <h1>
            Mgr. Jan Zrnovský a <br />
            Mgr. et Mgr. Lucie Zrnovská, advokátní kancelář
          </h1>
          <hr className="line" />
          <h2>Rodinná firma s více než 40 letou praxí v oboru.</h2>
          <button className="btn">Kontaktujte nás</button>
        </div>
      </main>
    </div>
  );
}

export default App;
